// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.19;

contract FreelanceAgreement {
    struct Milestone {
        string description;
        uint256 amount;
        uint256 deadline;
        bool completed;
        bool approved;
    }
    
    address public immutable client;
    address public immutable freelancer;
    Milestone[] public milestones;
    uint256 public totalFunded;
    uint256 public totalReleased;
    
    event MilestoneSubmitted(uint256 indexed index);
    event MilestoneApproved(uint256 indexed index, uint256 amountReleased);
    event ContractCancelled(uint256 amountReturned);

    constructor(
        address _freelancer,
        Milestone[] memory _milestones,
        uint256 _totalAmount
    ) payable {
        require(msg.value >= _totalAmount, "Insufficient ETH sent");
        require(_freelancer != address(0), "Invalid freelancer address");
        
        client = msg.sender;
        freelancer = _freelancer;
        totalFunded = msg.value;
        
        for (uint i = 0; i < _milestones.length; i++) {
            milestones.push(Milestone({
                description: _milestones[i].description,
                amount: _milestones[i].amount,
                deadline: _milestones[i].deadline,
                completed: false,
                approved: false
            }));
        }
    }

    function submitMilestone(uint256 index) external {
        require(msg.sender == freelancer, "Only freelancer can submit");
        require(index < milestones.length, "Invalid milestone index");
        require(!milestones[index].completed, "Milestone already submitted");
        
        milestones[index].completed = true;
        emit MilestoneSubmitted(index);
    }

    function approveMilestone(uint256 index) external {
        require(msg.sender == client, "Only client can approve");
        require(index < milestones.length, "Invalid milestone index");
        require(milestones[index].completed, "Milestone not submitted");
        require(!milestones[index].approved, "Milestone already approved");
        require(address(this).balance >= milestones[index].amount, "Insufficient contract balance");
        
        milestones[index].approved = true;
        totalReleased += milestones[index].amount;
        payable(freelancer).transfer(milestones[index].amount);
        
        emit MilestoneApproved(index, milestones[index].amount);
    }

    function cancelContract() external {
        require(msg.sender == client, "Only client can cancel");
        
        uint256 remainingBalance = address(this).balance;
        require(remainingBalance > 0, "No funds to return");
        
        payable(client).transfer(remainingBalance);
        emit ContractCancelled(remainingBalance);
    }

    function getMilestoneCount() external view returns (uint256) {
        return milestones.length;
    }
}
